BBC UK's Hustle (Season 1- 6)

The story of a group of elite con artists, who each week pull off a complicated scam with several twists. Mickey is the group's leader, who comes up with the plans. Albert is a veteran con man who in his later years is a &quot;roper,&quot; searching out suitable victims and introducing them to his cohorts. Ash comes up with all the locations and equipment needed for the cons. Stacie steps in whenever she needs to use her feminine wiles. The group is rounded off by Danny, a young amateur grifter who Mickey takes under his wing.
